import React, { useState } from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Image, FlatList } from 'react-native';
import { useNavigate } from 'react-router-dom';
import arrow from "./AlwaysActive/images/arrow.png";
import { personList, exponateList, auctionList } from '../Application/Classes/testDataGenerator';

const persons = personList;
const exponate = exponateList;
const auctions = auctionList;

const Home = ({ darkMode, isEnglish }) => {
    const navigate = useNavigate();

    const handleNavigation = (route) => {
        navigate(route);
    };

    const renderPerson = ({ item }) => (
        <View style={stylesContainers.listRow}>
            <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                {item.nachname}, {item.vorname}
            </Text>
        </View>
    );

    const renderExpon = ({ item }) => (
        <View style={stylesContainers.listRow}>
            <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>{item.exponatId}</Text>
            <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>{item.titel}</Text>
            <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>{item.kategorie}</Text>
            <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>{item.gewicht}</Text>
        </View>
    );

    const renderAuction = ({ item }) => (
        <View style={stylesContainers.listRow}>
            <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>{item.auktionId}</Text>
            <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>{item.titel}</Text>
            <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>{item.startPreis} €</Text>
            <Text style={[stylesTexts.listText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>{item.status}</Text>
        </View>
    );

    return (
        <View style={[stylesContainers.container, darkMode ? stylesContainers.darkBg : stylesContainers.lightBg]}>
            <View style={stylesContainers.welcomeView}>
                <Text style={[stylesTexts.welcomeText, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                    {isEnglish ? "Welcome!" : "Willkommen!"}
                </Text>
            </View>

            <View style={stylesContainers.diffcont}>
                {/* Exponate Liste */}
                <View style={[stylesContainers.viewListExponate, darkMode ? stylesContainers.darkBorder : stylesContainers.lightBorder]}>
                    <View style={stylesContainers.listHeader}>
                        <Text style={[stylesTexts.titleOfLists, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                            {isEnglish ? "Exhibits" : "Exponate"}
                        </Text>
                        <TouchableOpacity onPress={() => handleNavigation("/exponate")}>
                            <Image style={stylesTexts.images} source={arrow} />
                        </TouchableOpacity>
                    </View>

                    <View style={stylesContainers.listColumns}>
                        <Text style={stylesTexts.columnHeader}>{isEnglish ? "ID" : "ID"}</Text>
                        <Text style={stylesTexts.columnHeader}>{isEnglish ? "Title" : "Titel"}</Text>
                        <Text style={stylesTexts.columnHeader}>{isEnglish ? "Category" : "Kategorie"}</Text>
                        <Text style={stylesTexts.columnHeader}>{isEnglish ? "Weight" : "Gewicht"}</Text>
                    </View>

                    <FlatList
                        data={exponate}
                        renderItem={renderExpon}
                        keyExtractor={(item, index) => index.toString()}
                    />
                </View>

                {/* Personen Liste */}
                <View style={[stylesContainers.viewListPersonen, darkMode ? stylesContainers.darkBorder : stylesContainers.lightBorder]}>
                    <View style={stylesContainers.listHeader}>
                        <Text style={[stylesTexts.titleOfLists, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                            {isEnglish ? "Persons" : "Personen"}
                        </Text>
                        <TouchableOpacity onPress={() => handleNavigation("/persons")}>
                            <Image style={stylesTexts.images} source={arrow} />
                        </TouchableOpacity>
                    </View>

                    <Text style={stylesTexts.columnHeader}>{isEnglish ? "Name" : "Name"}</Text>
                    <FlatList
                        data={persons}
                        renderItem={renderPerson}
                        keyExtractor={(item, index) => index.toString()}
                    />
                </View>
            </View>

            {/* Auktionen Liste */}
            <View style={[stylesContainers.viewListAuktionen, darkMode ? stylesContainers.darkBorder : stylesContainers.lightBorder]}>
                <View style={stylesContainers.listHeader}>
                    <Text style={[stylesTexts.titleOfLists, darkMode ? stylesTexts.darkText : stylesTexts.lightText]}>
                        {isEnglish ? "Auctions" : "Auktionen"}
                    </Text>
                    <TouchableOpacity onPress={() => handleNavigation("/auction")}>
                        <Image style={stylesTexts.images} source={arrow} />
                    </TouchableOpacity>
                </View>

                <View style={stylesContainers.listColumns}>
                    <Text style={stylesTexts.columnHeader}>{isEnglish ? "Auction ID" : "Auktion-ID"}</Text>
                    <Text style={stylesTexts.columnHeader}>{isEnglish ? "Title" : "Titel"}</Text>
                    <Text style={stylesTexts.columnHeader}>{isEnglish ? "Starting Price" : "Startpreis"}</Text>
                    <Text style={stylesTexts.columnHeader}>{isEnglish ? "Status" : "Status"}</Text>
                </View>

                <FlatList
                    data={persons}
                    renderItem={renderPerson}  // Render jede Person
                    keyExtractor={(item, index) => index.toString()}
                    initialNumToRender={10}   // Zeige die ersten 10 Elemente an
                    maxToRenderPerBatch={10}  // Maximal 10 Elemente gleichzeitig rendern
                    windowSize={5}            // Fenstergröße für das virtuelle Rendering
                />
            </View>
        </View>
    );
};

const stylesContainers = StyleSheet.create({
    container: {
        flexDirection: "column",
        justifyContent: 'center',
        alignItems: 'center',
        width: 1350,
        paddingLeft: 20
    },
    lightBg: { backgroundColor: "#fff" },
    darkBg: { backgroundColor: "rgb(18, 18, 18)" },

    diffcont: {
        flexDirection: "row",
        padding: 20
    },

    viewListExponate: {
        borderRadius: 5,
        padding: 10,
        height: 300,
        width: 1000,
        margin: 10
    },
    viewListPersonen: {
        borderRadius: 5,
        padding: 10,
        height: 300,
        width: 300,
        margin: 10
    },
    viewListAuktionen: {
        borderRadius: 5,
        height: 300,
        width: 1325,
    },
    lightBorder: { borderWidth: 1, borderColor: "lightgray" },
    darkBorder: { borderWidth: 1, borderColor: "rgb(85, 129, 176)" },

    welcomeView: {
        paddingTop: 40,
        paddingBottom: 20,
    },
    listHeader: {
        flexDirection: "row",
        justifyContent: "space-between",
        marginLeft: 20,
        marginRight: 20,
        marginTop: 20
    },

    listColumns: {
        flexDirection: "row",
        justifyContent: "space-between",
        paddingVertical: 5,
        borderBottomWidth: 1,
        borderBottomColor: "lightgray"
    },
    listRow: {
        flexDirection: "row",
        justifyContent: "space-between",
        paddingVertical: 5,
        borderBottomWidth: 1,
        borderBottomColor: "#ddd"
    }
});

const stylesTexts = StyleSheet.create({
    columnHeader: {
        fontWeight: "bold",
        fontSize: 14,
        color: "rgb(85, 129, 176)"  // 🔵 Spaltennamen in Blau für bessere Lesbarkeit!
    },
    listText: {
        fontSize: 14
    },
});

export default Home;
